  {
    id: 1,
    name: "Mitesh",
    email: "mitesh@gmail.com",
  },
  {
    id: 2,
    name: "Jack",
    email: "jack@gmail.com",
  },
  {
    id: 3,
    name: "Ali",
    email: "Ali@gmail.com",
  },
];

export default class App extends React.Component {
  render() {
    return UserDetail(UserList, UserData);
  }
}

